import React, { Component } from 'react'
import PropTypes from 'prop-types'
import styled from 'styled-components'

const Wrapper = styled.div`
box-shadow: 0px 4px 35px rgba(168, 172, 176, 0.19);
background-color: ${(props) => props.theme.colors.white};

`

export class ProductCard extends Component {
  static propTypes = {
    product: PropTypes.object.isRequired,
  }

  render() {
    const {
      props: { product },
    } = this
    console.log(product.gallery[0])
    return (
      <Wrapper>
        <div className="product-card__content">
          <img src={product.gallery[0]} alt="" />
          <div className="product-card__content-text">
            <p className="product-card__content-text--name">{product.name}</p>
            {/* <p className='product-card__content-text--price'>{product.prices.currency.symbol}{product.prices.amount} </p> */}
          </div>
        </div>
      </Wrapper>
    )
  }
}

export default ProductCard
